import { gql } from "apollo-boost";

export const SEARCH_POSTS = gql`
  query searchPost($term: String!) {
    searchPost(term: $term) {
      id
      location
      caption
      user {
        id
        userName
        avatar
      }
      files {
        id
        url
      }
      likesCount
      isLiked
      comments {
        id
        text
        user {
          id
          userName
        }
      }
      createdAt
    }
  }
`;
